import { CommonModule } from '@angular/common';
import { Component, EventEmitter, Input, Output, inject, signal } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { NewTask } from '../task/task.model';
import { TasksSevice } from '../tasks.service';

@Component({
  selector: 'app-new-task',
  templateUrl: './new-task.component.html',
  styleUrls: ['./new-task.component.css'],
  standalone:true,
  imports:[FormsModule]
})
export class NewTaskComponent {
    @Input({required:true}) userId!:string;
    @Output() close=new EventEmitter<void>();

    // enteredTitle=signal('');
    // enteredSummary=signal('');
    // enteredDate=signal('');
    enteredTitle='';
    enteredSummary='';
    enteredDate='';
    private tasksService = inject(TasksSevice);

    onCancel(){
        this.close.emit();
    }

    onSubmit(){
        this.tasksService.addTask({
            title:this.enteredTitle,
            summary:this.enteredSummary,
            date:this.enteredDate
        },this.userId);
        this.close.emit();
    }
}
<div class="backdrop" (click)="onCancel()"></div>
<dialog open>
  <h2>Add Task</h2>
  <form (ngSubmit)="onSubmit()">
    <p>
      <label for="title">Title</label>
      <input type="text" id="title" name="title" [(ngModel)]="enteredTitle"/>
    </p>

    <p>
      <label for="summary">Summary</label>
      <textarea id="summary" rows="5" name="summary" [(ngModel)]="enteredSummary"></textarea>
    </p>

    <p>
      <label for="due-date">Due Date</label>
      <input type="date" id="due-date" name="due-date" [(ngModel)]="enteredDate"/>
    </p>

    <p class="actions">
      <button type="button" (click)="onCancel()">Cancel</button>
      <button type="submit">Create</button>
    </p>
  </form>
</dialog>
